package day5

const val input = ""

fun main(args: Array<String>) {
    println(p1())
    println(p2())
}

private fun p1(): Int {
    return fullyReact(input).length
}

private fun p2(): Int {
    var shortestPolymer = input.length

    val allChars = CharArray(26) { (it + 97).toChar() }
    allChars.forEach { c ->
        val strippedInput = input.replace(Regex("[$c${c.toUpperCase()}]"), "")
        val processedInput = fullyReact(strippedInput).length
        shortestPolymer = Math.min(shortestPolymer, processedInput)
    }
    return shortestPolymer
}

private fun fullyReact(input: String): String {
    var leftover = input
    var previousLeftover: String
    do {
        previousLeftover = leftover
        leftover = triggerFirstNextReaction(previousLeftover)
    } while (leftover.length < previousLeftover.length)

    return leftover
}

private fun triggerFirstNextReaction(sequence: String): String {
    var indexLeft = 0
    var indexRight = 1

    while (indexRight < sequence.length) {
        val left = sequence[indexLeft]
        val right = sequence[indexRight]

        indexLeft++
        indexRight++

        if (left.reactsWith(right)) {
            // Remove both.
            return sequence.replaceFirst("$left$right", "")
        } else if (indexRight + 1 == sequence.length) {
            // Reached the end. Return what is left
            return sequence
        }
    }

    return "something went wrong"
}

private fun Char.reactsWith(other: Char) = when {
    this.isUpperCase() -> this.toLowerCase().equals(other, ignoreCase = false)
    this.isLowerCase() -> this.toUpperCase().equals(other, ignoreCase = false)
    else -> false
}
